import "./GroupComponent4.css";

const GroupComponent4 = () => {
  return (
    <div className="ellipse-top">
      <img className="group-child1" alt="" src="../ellipse-11.svg" />
      <img className="group-child2" alt="" src="../ellipse-21.svg" />
      <img className="group-child3" alt="" src="../ellipse-32.svg" />
    </div>
  );
};

export default GroupComponent4;
